import React from 'react';
import Accueil from "./component/Accueil"
import Register from "./component/Register"
import {
  BrowserRouter as Router,
  Switch,
  Route
} from "react-router-dom";
import {Container} from 'react-bootstrap';


function App() {
  return (
    <Container fluid>
      <Router>
        <Switch>
          <Route path="/" exact component={Accueil} category="ok"/>
          <Route path="/register"><Register path={{pathname:"register"}}/></Route>/>
          <Route path="/signin"><Register path={{pathname:"signin"}}/></Route>/>
          <Route path="/ok" exact component={Accueil} category="ok"/>

        </Switch>
      </Router>
    </Container>
  );
}

export default App;
